//these functions use data uri's to produce beep and a cat sound but are very long so code folding will be helpful.:)
function beep() {
    let snd = new Audio("data:audio/wav;base64,");
    snd.play();
}

function catSound() {
    let snd = new Audio("data:audio/mpeg;base64,");
    snd.play();
}